import React, {useState} from "react";
import useContactanos from "../components/useContactanos";



const Contactanos = () => {

    const initialData = {
        id: '',
        nombre:"",
        rut: "",
        numserie: "",
        celular: "",
        email: "",
        terminos: false,

    };

    const [termino, setTermino] = useState(false);

    const onChangeTermino = (e) => {
        setTermino(e.target.checked);
        console.log(e.target.checked)
    };


    const onValidate = (form) => {



        let isError = false
        let errors = {} 
        let expRegTexto = /^[A-Za-zÑñÁáÉéÍíÓóÚú\s]+$/;
        let expRegRut = /^(\d{1,2}(?:\.\d{1,3}){2}-[\dkK])$/;
        let expRegEmail = /(\w+[/./-]?){1,}@[a-z]+[/.]\w{2,}$/;
        let expRegTelefono = /^(\+?56)?(\s?)(0?9)(\s?)[98765432]\d{7}$/;
        let expRegNumSerie = /^(\d{3}(?:\.\d{3})(?:\.\d{3}))$/;

        if(!form.nombre.trim()){
            errors.nombre = "El campo Nombre no debe estar vacio."
            isError = true
        }else if(!expRegTexto.test(form.nombre)){
            errors.nombre= "Formato invalido, el campo Nombre solo acepta letras y espacios"
            isError = true
        }

        if(!form.rut.trim()){
            errors.rut = "El campo Rut no debe estar vacio."
            isError = true
        }else if(!expRegRut.test(form.rut)){
            errors.rut= "Formato invalido"
            isError = true
        }

        if(!form.numserie.trim()){
            errors.numserie = "El campo numero de Serie no debe estar vacio."
            isError = true
        }else if(!expRegNumSerie.test(form.numserie)){
            errors.numserie= "Formato invalido"
            isError = true
        }

        if(!form.celular.trim()){
            errors.celular = "El campo numero de Celular no debe estar vacio."
            isError = true
        }else if(!expRegTelefono.test(form.celular)){
            errors.celular= "Formato invalido"
            isError = true
        }

        if(!form.email.trim()){
            errors.email = "El campo numero de Email no debe estar vacio."
            isError = true
        }else if(!expRegEmail.test(form.email)){
            errors.email= "Formato invalido"
            isError = true
        }
        if(!form.terminos === true){
            errors.terminos = "Acepte los terminos y condiciones."
            isError = true

        }



        return isError ? errors : null
    };




    const {form, errors,handleChange, handleSubmit} = useContactanos(initialData, onValidate)

  return (
    <div className="container">
      <div>
        <div className="d-flex justify-content-center my-5">
          <h2>Formulario de contacto</h2>
        </div>
        <div className="my-3 mx-5">
          <p>
            Recuerda que este formulario es para que uno de nuestros ejecutivos
            te contacten para finiquitar tu inscripcion y ser parte de nuestro
            banco
          </p>
        </div>
      </div>
      <form  onSubmit={handleSubmit}>
        <div className="d-flex">
            <div className="mb-3 justify-content-center my-3 mx-5">
                <div className="my-3">
                    <label className="form-label">Nombre completo</label>
                    <input type="text" className="form-control w-50" name="nombre" id="nombre" onChange={handleChange} />
                    {errors.nombre && <div className="alert alert-danger p-2 w-50 mt-1" role="alert">{errors.nombre}</div>}
                </div>
                <div className="my-3">
                    <label  className="form-label">Rut</label>
                    <input type="text" className="form-control w-50" id="rut" name="rut" onChange={handleChange} />
                    {errors.rut && <div className="alert alert-danger p-2 w-50 mt-1" role="alert">{errors.rut}</div>}
                </div>
                <div className="my-3">
                    <label className="form-label">Numero de serie</label>
                    <input type="text" className="form-control w-50" id="numSerie" name="numserie" onChange={handleChange}/>
                    {errors.numserie && <div className="alert alert-danger p-2 w-50 mt-1" role="alert">{errors.numserie}</div>}
                </div>
                <div className="my-3">
                    <label  className="form-label">Celular</label>
                    <input type="text" className="form-control w-50" id="celular" name="celular" onChange={handleChange}/>
                    {errors.celular && <div className="alert alert-danger p-2 w-50 mt-1" role="alert">{errors.celular}</div>}
                </div>
                <div className="my-3">
                    <label className="form-label">Email</label>
                    <input type="text" className="form-control w-50" id="email" name="email" onChange={handleChange}/>
                    {errors.email && <div className="alert alert-danger p-2 w-50 mt-1" role="alert">{errors.email}</div>}
                </div>
                <div className="my-5">
                    <input type="checkbox" name="terminos" checked={termino} onChange={onChangeTermino}/>
                    {errors.terminos && <div className="alert alert-danger p-2 w-50 mt-1" role="alert">{errors.terminos}</div>}

                    <br />
                    <p>He leido y acepto los terminos y condiciones de la evaluacion y aceptp participar en el programa de contato para ser parte del Banco Ciisa, aceptando su politica y provacidad.</p>
                </div>
                <div className="my-5">
                    <button type="submit"  onClick={handleSubmit}>Enviar formulario</button>
                </div>
            </div>
        </div>
      </form>
    </div>
  );
};

export default Contactanos;
